import React from "react";

function TodoItem(props) {
	return (
		<div className='todo-item'>
			<input type='checkbox' checked={props.tData.completed} onChange={ () => "I was Clicked" } />
			<p className='todo-para'>{props.tData.text}</p>
		</div>
	);
} 

export default TodoItem;
